};



const Header: FC<HeaderProps> = ({finalPrice, productTypeValue, onProductTypeChange}) => {


    return (
        <div>
            <section className="header-top">
                <div className="container header-top__container">
                <div className="header-top__left">
                <div className="header-top__block">
                <svg width="16" height="18" viewBox="0 0 16 18" fill="none" xmlns="http://www.w3.org/2000/svg">
<path d="M7.99967 0.666748C6.23156 0.666748 4.53587 1.36913 3.28563 2.61937C2.03539 3.86961 1.33301 5.5653 1.33301 7.33342C1.33301 8.91008 1.66801 9.94175 2.58301 11.0834L7.99967 17.3334L13.4163 11.0834C14.3313 9.94175 14.6663 8.91008 14.6663 7.33342C14.6663 5.5653 13.964 3.86961 12.7137 2.61937C11.4635 1.36913 9.76778 0.666748 7.99967 0.666748V0.666748Z" stroke="#3F4E65" stroke-width="1.3" stroke-linecap="round" stroke-linejoin="round"/>
</svg>

                    <div className="header-top__body"></div>
                </div>
                <div className="header-top__block">
                    <div className="header-top__body"></div>
                </div>
                </div>
                <div className="header-top__right"></div>
                </div>
            </section>


            <div className="header">MAIN HEADER
                <button>Корзина: {finalPrice} ₸</button>
            </div>

        </div>
    )
}

export default Header;
